   console.log(55,posts.data)
   const dispatch =  useDispatch();

useEffect(()=>{
  dispatch(show_posts())
},[])

  return (
    <div>
      {posts?.data?.map((item,index)=>{
        return(
          <div key ={index}>
          <p>{item.id}</p>

          </div>
        )
      })}
    </div>
  )
}
